def my_func(input1: str) -> str:
    if not (1 <= len(input1) <= 100):
        return ""

    def find_target(input_str):
        if len(input_str) < 2:
            return input_str

        result = ""
        max_count = 0

        for i in range(len(input_str)):
            for j in range(i + 1, len(input_str)):
                substring = input_str[i:j + 1]
                count = input_str.count(substring)

                if count > max_count or (count == max_count and len(substring) > len(result)):
                    max_count = count
                    result = substring

        return result

    return find_target(input1)
